import React from 'react'
import "./about.css"
import ME_CV from "../../my_img/my_cv_img.jpg"


const About = () => {
  return (
    <section id='about'>
     <div className="container__about">
       <img src={ME_CV} alt="my_cv" />
     </div>
    </section>
  )
}

export default About
